import React from 'react'
import TreePic from '../images/Tree.png';
import BackButton from '../shared/buttons/back-button';
import './treeView.css';
import ConsumerDock from '../shared/consumer-dock/consumer-dock';
import ConsumerWithDockOpened from '../shared/consumer-dock/consumer-with-dock-opened/consumer-with-dock-opened';

function TreeView() {
    return (
        <div className="tree-parent">

        <img className="tree-image" src={ TreePic } alt="something"/>
        <div className="consumer-dock">
        <ConsumerWithDockOpened></ConsumerWithDockOpened>
        </div>
        <BackButton></BackButton>
        </div>
    );
  }

  export default TreeView;
